import React from "react";
import pizzaHurt from '../components/PizzaHurt';

let pizza = () =>{
    return(
        <React.Fragment>
            <div className="p-3">
                <div className="row">
                    <dic className="col-md-5">
                        <div className="card-body">
                        <p className="pizza">Pizza</p>
            <p className="lead">this is new pizza in store </p>
            <img src="" alt="image-fluid"/>
                        </div>
                    </dic>
                </div>

            </div>
            <p className="pizza">Pizza</p>
            <p className="lead">this is new pizza in store </p>
            <img src="" alt="image-fluid"/>
            
        </React.Fragment>
    )
}
export default pizzaHurt;
